    [],nt"revision_timestamp": "2013-03-15T16:40:20.288728",nt"name": "a-coverage-that-differentiates-between-areas-where-the-total-calico-and-a-sequence-coal-bearing6b9a0",nt"isopen":
    false,nt"url": null,nt"notes": "This is a polygon coverage that represents
    areas underlain by the coal-bearing Calico and A-sequences of the Straight Cliffs
    Formation east of 112 degrees of longitude. It differentiates between areas that
    contain the entire coal-bearing interval and areas where the coal-bearing strata
    are partially eroded. The outermost polygon defines the base of the Calico and A-sequences.
    The inner polygon shows where the complete coal-bearing interval is preserved. The
    area between the outer and inner polygon shows where the coal-bearing rocks are
    partially eroded. The northern boundary is delineated by the Paunsaugunt fault and
    volcanic rocks of Tertiary age.",nt"license_title": null,nt"extras": [{ntt"key":
